import { Component } from "react";
import Chart from "react-google-charts";
import { GlobalThemes } from "../../ThemeManager";

const EnterpriseTheme = ({}: {}) => {
  return (
    <div className={"contentContainer " + GlobalThemes.Enterprise}>
      <div className="headline one">{GlobalThemes.Enterprise.toString()}</div>
      <div className="cardContainer">
        <div className={"card"}>
          <div className="headline two">Expense Chart</div>
          <Chart
            chartType="PieChart"
            loader={<div>Loading Chart</div>}
            data={[
              ["Expense", "Cost"],
              ["Travel", 11],
              ["Advertisement", 2],
              ["Client-Expenses", 2],
              ["Out-sourcing", 2],
              ["Logistics", 7],
            ]}
            options={{
              title: "Expenses",
              legend: "none",
              pieSliceText: "label",
              slices: {
                4: { offset: 0.2 },
                12: { offset: 0.3 },
                14: { offset: 0.4 },
                15: { offset: 0.5 },
              },
            }}
            rootProps={{ "data-testid": "1" }}
          />
        </div>
        <div className="card">
          <div className="headline two">Popularity Chart</div>

          <Chart
            chartType="LineChart"
            loader={<div>Loading Chart</div>}
            data={[
              ["x", "dogs", "cats"],
              [0, 0, 0],
              [1, 10, 5],
              [2, 23, 15],
              [3, 17, 9],
              [4, 18, 10],
              [5, 9, 5],
              [6, 11, 3],
              [7, 27, 19],
            ]}
            options={{
              hAxis: {
                title: "Time",
              },
              vAxis: {
                title: "Popularity",
              },
              series: {
                1: { curveType: "function" },
              },
            }}
            rootProps={{ "data-testid": "2" }}
          />
        </div>
        <div className="card">
          <Chart
            chartType="BarChart"
            loader={<div>Loading Chart</div>}
            data={[
              ["City", "2010 Population", "2000 Population"],
              ["New York City, NY", 8175000, 8008000],
              ["Los Angeles, CA", 3792000, 3694000],
              ["Chicago, IL", 2695000, 2896000],
              ["Houston, TX", 2099000, 1953000],
              ["Philadelphia, PA", 1526000, 1517000],
            ]}
            options={{
              title: "Population of Largest U.S. Cities",
              chartArea: { width: "50%" },
              isStacked: true,
              hAxis: {
                title: "Total Population",
                minValue: 0,
              },
              vAxis: {
                title: "City",
              },
            }}
            // For tests
            rootProps={{ "data-testid": "3" }}
          />
        </div>
        <div className="card">
          <Chart
            chartType="Gauge"
            loader={<div>Loading Chart</div>}
            data={[
              ["Label", "Value"],
              ["Memory", 90],
              ["CPU", 10],
              ["Network", 70],
            ]}
            options={{
              redFrom: 90,
              redTo: 100,
              yellowFrom: 75,
              yellowTo: 90,
              minorTicks: 5,
            }}
            rootProps={{ "data-testid": "1" }}
          />
        </div>
      </div>
    </div>
  );
};
export default EnterpriseTheme;
